class Node:    def __init__(self, data):        self.data_ = data        self.next_ = Noneclass LinkedList:    def __init__(self):        self.head = None        self.node = None        self.count = 0    def print_(self):        temp = self.head        print('---------')        while temp != None:            print('This is data: ',temp.data_)            temp = temp.next_            print('THis is address:',temp)            #print('this is address: ', temp.next_)    def insert(self, value):        self.node = Node(value)        if(self.head == None or self.count == 0):            self.head = Node(value)        elif(self.node == None or self.count == 1):            self.head.next_ = Node(value)            print(self.head.data_)            self.node = Node(value)            print(self.node.data_)            print('------->',self.node.next_)        else:                        self.node = Node(value)            print('While insertion data ',self.node.data_)            self.node.next_ = self.node            print('While insertion next address ',self.node.next_)            #print('------->',node.next_)        self.count = self.count + 1        self.print_()        linkedlist = LinkedList()linkedlist.insert(9)linkedlist.insert(91)linkedlist.insert(91)linkedlist.insert(911)linkedlist.insert(19)linkedlist.insert(119)linkedlist.print_()